  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Crosby
  Waterfowl Production Area Management Office outlines Refuge accomplishments during
  the 1966 calendar year. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover conditions during the year.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and vegetation control. Resource
  management is outlined; topics include grazing. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, and
  safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
